            {
                method: "POST",
                headers: {
                    "Content-Type": 'application/json',
                    'Authorization': 'Bearer '
                },
                body: JSON.stringify({
                    post: {
                      title,
                      description,
                      price,
                      willDeliver,
                    }
                 })
            });
        } catch (error) {
            throw error;
        }
    }

    return (
        <div>
            <form>
                <label>
                    Title:
                    <input type='text'></input>
                </label>
                <label>
                    Description:
                    <input type='text'></input>
                </label>
                <label>
                    Price:
                    <input type='text'></input>
                </label>
            </form>
        </div>
    )
}

export default CreateNewPost;
